<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">

    <title>Pokemon Cache</title>
     <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"
     integrity="sha256-p4NxAoJBhIIN+hmNHrzRCf9tD/miZyoHS5obTRR9BMY="
     crossorigin=""/>
      <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"

     <style>
        body{
            margin:0;
            padding:0;
        }
        #map {
            height:100dvh;
            display:flex;
            z-index:8;
            transition:0.3s;
        }

        #centreer{
            /*width:4.6vh;
            height: 4.6vh;*/
            width: 30px;
            height: 29px;
            line-height: 26px;
            border-radius: 4px;
            outline:none;
            background:linear-gradient(135deg,rgba(255,255,255,0.2),rgba(255,255,255,0.3));
            backdrop-filter: blur(4px);
            border:2px solid #16161652;
            display:flex;
            z-index:9;
            align-items:center;
            justify-content:center;
            position:absolute;
            left:10px;
            top: 80px;
            /*font-size:calc(1.2vw + 15px);*/
            /*font: 18px/20px Tahoma, Verdana, sans-serif;*/
            font-family:monospace;
            font-size: 20px;
            user-select: none;
            /*min-width:30px;
            min-height:30px;*/
        }

        #centreer:focus{
            transition:0.3s;
            background-color: #f4f4f4;
        }

        #centreer p{
            position:absolute;
            left:50%;
            transform: translate(-50%,-4%);
            user-select: none;
            font-weight:500;
        }

        #unlock{
            width:100dvw;
            height:100dvh;
            background:linear-gradient(135deg,rgba(78, 78, 78, 0.5),rgba(58, 58, 58, 0.7));
            backdrop-filter: blur(4px); 
            display:flex;
            z-index:9999999;
            position:absolute;
            left:50%;
            top:50%;
            transform: translate(-50%,-50%);
            display:flex;
            opacity: 0;
            visibility: hidden;
            transition:0.2s;
        }

        #pokemon{
            width:50dvw;
            height:50dvw;
            position:absolute;
            left:50%;
            top:50%;
            transform: translate(-50%,-50%);
            user-select: none;
        }

        #pokeball {
            width:40dvw;
            height:40dvw;
            position:absolute;
            background: url("https://art.ngfiles.com/images/386000/386577_stardoge_8-bit-pokeball.png?f1446737358");
            background-size: cover;
            left:50%;
            top:49%;
            transform: translate(-50%,-50%);
            user-select: none;
            display:none;
        }

        #kruis {
            width:50dvw;
            height:50dvw;
            position:absolute;
            background: url("https://upload.wikimedia.org/wikipedia/commons/thumb/5/5f/Red_X.svg/2048px-Red_X.svg.png");
            background-size: cover;
            left:50%;
            top:50%;
            transform: translate(-50%,-50%);
            user-select: none;
            display:none;
        }

        #sluit{
           width:2vw;
            height: 2vw;
            border-radius: 3px;
            outline:none;
            background:linear-gradient(135deg,rgba(255,255,255,0.5),rgba(255,255,255,0.7)) !important;
            backdrop-filter: blur(4px) !important; 
            border:2px solid #c8c8c6b7;
            display:flex;
            z-index:9;
            align-items:center;
            justify-content:center;
            position:absolute;
            right:3vw;
            top:3vw;
            font-size:calc(1.2vw + 15px);
            min-width:30px;
            min-height:30px; 
            user-select: none;
            transition:0.3s;
        }

        #nav{
            display:flex;
            z-index:96;
            position:relative;
            gap:5vw;
            justify-content: center;
            align-items: center;
            position:fixed;
            bottom: 3vh;
            left:50%;
            transform: translate(-50%,-50%);
            width:37dvw;
            height:10vw;
            border-radius:50px;
            background:linear-gradient(135deg,rgba(255,255,255,0.2),rgba(255,255,255,0.3));
            backdrop-filter: blur(4px);
            border:1px gray solid;
        }
        #nav #homesvg{
            fill:burlywood;
            transition:0.3s;
        }
        #nav svg{
            width:8vw;
            height:8vw;
            fill:rgb(33, 33, 33);
            transition:0.3s;
        }

        .leaflet-control{
           background:linear-gradient(135deg,rgba(255,255,255,0.2),rgba(255,255,255,0.3));
            backdrop-filter: blur(4px); 
        }
        .leaflet-bar{
           background:linear-gradient(135deg,rgba(255,255,255,0.0),rgba(255,255,255,0.0));
            backdrop-filter: blur(4px); 
        }

        .leaflet-bar a:active{
           background:linear-gradient(135deg,rgba(255,255,255,0.0),rgba(255,255,255,0.0));
            backdrop-filter: blur(4px); 
        }

        .leaflet-bar a:focus{
           background:linear-gradient(135deg,rgba(255,255,255,0.0),rgba(255,255,255,0.0));
            backdrop-filter: blur(4px); 
        }

        .leaflet-bar a:hover{
           background:linear-gradient(135deg,rgba(255,255,255,0.0),rgba(255,255,255,0.0));
            backdrop-filter: blur(4px); 
        }

        .leaflet-bar:focus{
           background:linear-gradient(135deg,rgba(255,255,255,0.0),rgba(255,255,255,0.0));
            backdrop-filter: blur(4px); 
        }

        .leaflet-bar:active{
           background:linear-gradient(135deg,rgba(255,255,255,0.0),rgba(255,255,255,0.0));
            backdrop-filter: blur(4px); 
        }

        .leaflet-bar a{
           background:linear-gradient(135deg,rgba(255,255,255,0.2),rgba(255,255,255,0.3));
            backdrop-filter: blur(4px); 
        }

        .leaflet-disabled{
           background:linear-gradient(135deg,rgba(255,255,255,0.2),rgba(255,255,255,0.3)) !important;
            backdrop-filter: blur(4px) !important; 
        }

        #settings{
            width:96dvw;
            padding:2vw;
            height:calc(100dvh - 4vw);
            overflow:hidden;
            background-color: rgb(233, 233, 233);
            display:flex;
            z-index:92;
            justify-content:center;
            position:absolute;
            display:none;
            transition:0.3s;
        }
        .tilesoort{
            width:25vw;
            height:25vw;
            border:2px solid burlywood;
            border-radius: 15px;
            transition: 0.3s;
            user-select: none;
        }

        .tilesoort:active{
            transform: scale(1.2);
            transition: 0.3s;
        }

        #tilecontainter{
            height:30dvh;
            width:96dvw;
            display:flex;
            flex-wrap:wrap;
            padding:2dvw;
            flex-direction:row;
            gap:4vw;
            justify-content:center;
        }

        #light{
            background:url(white.png);
            background-size:cover;
            user-select: none;
        }
        #dark{
            background:url(black.png);
            background-size:cover;
            user-select: none;
        }
        #voyager{
            background:url(voyager.png);
            background-size:cover;
            user-select: none;
        }
        #satellite{
            background:url(satellite.png);
            background-size:cover;
            user-select: none;
        }
        #standard{
            background:url(standard.png);
            background-size:cover;
            user-select: none;
        }
        #geel{
            background:url(geel.png);
            background-size:cover;
            user-select: none;
        }

        .leaflet-control-attribution {
            font-size: 10px;
            opacity: 0.7;
            border-radius:5px;
            background: rgba(255, 255, 255, 0.2); /* lichte achtergrond */
            backdrop-filter: blur(4px);
            bottom:3px;
            right:3px;
        }

        #collection{
            width:96dvw;
            padding:2vw;
            height:calc(100dvh - 4vw);
            background-color: rgb(233, 233, 233);
            display:flex;
            z-index:92;
            justify-content:center;
            position:absolute;
            display:none;
            top:0;
            left:0;
            overflow-x:hidden;
            user-select: none;
            transition:0.3s;
        }
        .pokémon{
            width:25vw;
            height:25vw;
            border:2px solid gray;
            border-radius: 15px;
            user-select: none;
            transition:0.3s;
            position:relative;
            overflow:hidden;
        }

        .pokémon h3{
            position:absolute;
            bottom:0;
            right:0;
            transform: translate(1%,60%);
            color:white;
            background: burlywood;
            padding:1vw;
            min-width:10vw;
            border-radius:5px;
            font-family:arial;
            font-size:3vw;
        }

        #pokecontainter{
            height:75dvh;
            width:95dvw;
            position:absolute;
            left:50%;
            top:7%;
            transform: translate(-50%,0%);
            display:flex;
            flex-wrap:wrap;
            padding:2dvw;
            padding-top:2dvh;
            padding-bottom:15dvh;
            flex-direction:row;
            gap:4vw;
            justify-content:center;
            max-height:100dvh;
            overflow-y:auto;
        }
        
        .toggle{
            width:8vw;
            height:4vw;
            background-color: gray;
            border: 2px solid black;
            border-radius:50px;
            position:absolute;
            display:flex;
            align-items:center;
            right:5%;
            transition:0.3s;
            user-select: none;
            cursor:pointer;
            -webkit-tap-highlight-color: transparent;
            outline:none;
        }

        .toggle:focus{
            outline:none;
        }

        .togglecirc{
            background-color: #eef3ef;
            height:4vw;
            width:4vw;
            border-radius:50px;
            position:absolute;
            left:0%;
            transition:0.3s;
            cursor:pointer;
            user-select: none;
            -webkit-tap-highlight-color: transparent;
        }

        #toggle1cont{
            position:relative;
            font-family:arial;
            position:absolute;
            top:50%;
            left:50%;
            transform:translate(-50%,-50%);
            width:84dvw;
            padding:4vw;
            height:8vw;
            display:flex;
            align-items:center;
            user-select: none;
        }

        h1{
            user-select: none;
        }

        #progress {
            background-color: burlywood;
            border-radius: 50px;
            height:3vh;
        }
        #progressbar{
            background-color:white;
            border-radius:50px;
            width:80dvw;
            height:3vh;
            position:absolute;
            left:50%;
            /*top:1vh;*/
            transform: translate(-50%,0%);
            overflow:hidden;
        }

        /*input[type=range]::-webkit-slider-thumb{
            display:none;
            background-color: transparent;
            border:none;
            outline:none;
        }*/

        #collection h2{
            font-family: arial;
            color:black;
            font-size:5vw;
        }
        #leveltekst{
            position:absolute;
            left:1%;
            transform: translate(0%,0%);
        }
        #naarleveltekst{
            position:absolute;
            right:1%;
            transform: translate(0%,0%);
        }
        #topbar{
            width:100%;
            height:3vh;
            display:flex;
            align-items: center;
            justify-content: center;
            position:relative;
            top:2dvh;
            user-select: none;
            /*border:solid red 2px;*/
        }


        .circle {
            width:46px;
            width:46px;
            border-radius:50%;
            background-color:rgba(255, 0, 0, 0.364);
            display: flex;
            justify-content: center;
            align-items: center;
            border:2px solid black;
        }

        #vangbalk{
            background-color:rgb(255, 69, 69);
            border-radius:50px;
            width:80dvw;
            height:3vh;
            position:relative;
            left:50%;
            top:95dvh;
            transform: translate(-50%,-50%);
            overflow:hidden;
        }
        #hierin{
          width:30dvw;  
          height:3vh;
          background-color:rgb(92, 171, 74);
          position:absolute;
          left:50%;
          transform: translate(-50%,0%);
        }
        #slider{
          width:1dvw; 
          height:3vh;
          border-radius: 50px;
          position:absolute;
          left:0px;
          background-color:burlywood;
        }

     </style>

    <script>

        var map = L.map('map').setView([51.5, -0.09], 17);

        //wit - zwart
        var white = L.tileLayer('https://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}.png', {
            attribution: '&copy; <a href="https://carto.com">CartoDB</a>'
        });

        //zwart - wit
        var black = L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors &copy; <a href="https://carto.com/">CARTO</a>',
            subdomains: 'abcd',
            maxZoom: 20
        });

        //voyager
        var voyager = L.tileLayer('https://{s}.basemaps.cartocdn.com/rastertiles/voyager/{z}/{x}/{y}{r}.png', {
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors &copy; <a href="https://carto.com/">CARTO</a>',
            subdomains: 'abcd',
            maxZoom: 20
        });

        //satteliet
        var satellite = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', {
            attribution: '&copy; <a href="https://www.esri.com">Esri</a>'
        });

        //standaard
        var standard = L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
            maxZoom: 19, attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>' 
        });

        //opentopop?
        var geel = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Street_Map/MapServer/tile/{z}/{y}/{x}', {
            attribution: 'Tiles &copy; Esri &mdash; &copy; OSM'
        });

        
//standard.addTo(map);
var currentLayer = standard;
var savemap = 'standard';

function changemap(jef, savemapp){
map.removeLayer(currentLayer); 
jef.addTo(map);    
currentLayer = jef;
savemap = savemapp;
saveeverything();
}

function changemapp(jef, savemapp){
map.removeLayer(currentLayer); 
jef.addTo(map);    
currentLayer = jef;
savemap = savemapp;
}


function settings(){
    document.getElementById("settings").style.display = "flex";
    document.getElementById("collection").style.display = "none";
    document.getElementById("homesvg").style.fill = "black";
    document.getElementById("collectsvg").style.fill = "black";
    document.getElementById("settingssvg").style.fill = "burlywood";
}

function collection(){
    document.getElementById("collection").style.display = "flex";
    document.getElementById("settings").style.display = "none";
    document.getElementById("homesvg").style.fill = "black";
    document.getElementById("collectsvg").style.fill = "burlywood";
    document.getElementById("settingssvg").style.fill = "black";
}

function home(){
    document.getElementById("settings").style.display = "none";
    document.getElementById("collection").style.display = "none";
    document.getElementById("homesvg").style.fill = "burlywood";
    document.getElementById("collectsvg").style.fill = "black";
    document.getElementById("settingssvg").style.fill = "black";
}

}

        const requestOptions = {
        method: "POST",
        headers: myHeaders,
